"use strict";function getPopularMovies(){$.ajax({url:"/Home/GetPopularMovies",success:function(n){console.log(n);let t=n.results;$("body").append(`<div style = "margin-bottom:50px;">  
                         <h1>Movie of the Day</h1>
                         <p>${t[0].original_title}</p>
                         <img src = "https://image.tmdb.org/t/p/w500${t[0].poster_path}">
                     </div>`);for(let n=1;n<9;n++)console.log(),$("body").append(`<div style = "margin-bottom:20px;">  
                            <h2>${t[n].original_title}</h2>
                            <img src = "https://image.tmdb.org/t/p/w500${t[n].poster_path}">
                        </div>`)},error:function(){console.log("Error bitches!")}})}$(document).ready(function(){getPopularMovies()});